            $grobnoMesto = $uplatilac->grobnaMesta()->first();
            if (!$grobnoMesto) continue;

            // Formatiraj datume u YYYY-MM-DD
            $datum = self::parseDate($row['datum']);
            $naplaceno = self::parseDate($row['naplaceno']);
            
            // Ako je naplaceno 'nije', koristi datum kao datum uplate i označi kao uplaćeno
            if (strtolower(trim($row['naplaceno'])) === 'nije') {
                $datum_uplate = $datum;
                $uplaceno = true;
            } else {
                $datum_uplate = $naplaceno ?: $datum;
                $uplaceno = !empty($row['naplaceno']);
            }

            // Ako je period null, koristi originalni string iz 'datum'
            $period = $datum ?: $row['datum'];
            if (!$datum_uplate) {
                echo "[WARN] Preskačem uplatu za sifru {$row['sifraUplatioca']} - nema validnog datuma (datum: '{$row['datum']}', naplaceno: '{$row['naplaceno']}')\n";
                continue;
            }

            Uplata::create([
                'grobno_mesto_id' => $grobnoMesto->id,
                'uplatilac_id' => $uplatilac->id,
                'iznos' => $row['iznos'],
                'datum_uplate' => $datum_uplate,
                'period' => $period, // period je originalni datum ako nema validnog
                'uplaceno' => $uplaceno,
                'napomena' => 'Izmirena godina: ' . $row['izmirenaGodina'],
                'za_koga' => null,
            ]);
        }
    }

    private static function parseDate($date)
    {
        if (!$date) return null;
        $date = trim($date);
        // Ukloni tačku na kraju ako postoji
        if (substr($date, -1) === '.') {
            $date = substr($date, 0, -1);
        }
        $date = str_replace('.', '-', $date);
        $parts = explode('-', $date);
        if (count($parts) === 3) {
            $d = str_pad($parts[0], 2, '0', STR_PAD_LEFT);
            $m = str_pad($parts[1], 2, '0', STR_PAD_LEFT);
            $y = $parts[2];
            if (strlen($y) === 2) $y = '20' . $y;
            return "$y-$m-$d";
        }
        return null;
    }
